import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import Blog from "./pages/Blog";
import Cats from "./pages/Cats";
import Dogs from "./pages/Dogs";
import Mission from "./pages/Mission";
import Team from "./pages/Team";
import Services from "./pages/Services";
import Contribute from "./pages/Contribute";
import Charlie from "./individual-pets/Charlie";
import Marley from "./individual-pets/Marley";
import Grisou from "./individual-pets/Grisou";
import Angel from "./individual-pets/Angel";
import Lili from "./individual-pets/Lili";


const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="*" element={<Home />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/cats" element={<Cats />} />
        <Route path="/dogs" element={<Dogs />} />
        <Route path="/mission" element={<Mission />} />
        <Route path="/team" element={<Team />} />
        <Route path="/services" element={<Services />} />
        <Route path="/contribute" element={<Contribute />} />
        <Route path="/charlie" element={<Charlie />} />
        <Route path="/lili" element={<Lili />} />
        <Route path="/marley" element={<Marley />} />
        <Route path="/grisou" element={<Grisou />} />
        <Route path="/angel" element={<Angel />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
